import React from 'react';
import Header from "./Header";

function AboutMe() {
    return(
        <section className="section-aboutme" id="aboutme">        
        <div className="about-me-container">
            <h1>About Me</h1>
            <Header />
               <p class="section__subtitle section__title--aboutme">Hej! Mitt namn är <strong>Viktor Persson</strong> och jag är utbildad i Fullstack .NET på Teknikhögskolan i Göteborg.
                Jag är bosatt i älvängen med min Sambo. <br/>
                På fritiden så gillar jag att spenderna tid på gymmet, framför datorn och umgås med vänner.<br/> <br/>
                Tanken med denna sida är att använda den som ett digitalt-CV där ni får chans att kolla in mina tidigare projekt och få en överblick i min kunskap.</p>    
        </div>
        </section>
            
    )

}

export default AboutMe;
